                        <h6>Phone Number</h6>
                    </div>
                    <div className={'col'}>
                        <h6>Course Name</h6>
                    </div>
                    <div className={'col'}>
                        <h6>Status</h6>
                    </div>
                    <div className={'col'}>
                        <h6>Comments</h6>
                    </div>
                    <div className={'col'}>
                        <h6> &nbsp; </h6>
                    </div>
                    </div>
                </div>


                {/*<div className={'body-row'}>*/}
                {/*    <div className={'row'}>*/}
                {/*        <div className={'col'}>*/}
                {/*            <h6>{agentData.firstname}</h6>*/}
                {/*        </div>*/}
                {/*        <div className={'col'}>*/}
                {/*            <h6>{agentData.phonenumber}</h6>*/}
                {/*        </div>*/}
                {/*        <div className={'col'}>*/}
                {/*            <h6>{agentData.interestedcourse}</h6>*/}
