                {/*        <div className={'col'}>*/}
                {/*            <button> view </button>*/}
                {/*        </div>*/}
                {/*    </div>*/}
                {/*</div>*/}


            <div className={'body-row'}>
                <div className={'row'}>
                    <div className={'col'}>
                        <h6>firstname</h6>
                    </div>
                    <div className={'col'}>
                        <h6>phonenumber</h6>
                    </div>
                    <div className={'col'}>
                        <h6>interestedcourse</h6>
                    </div>
                    <div className={'col'}>
                        <h6>status</h6>
                    </div>
                    <div className={'col'}>
                        <h6>notes</h6>
                    </div>
                    <div className={'col'}>
                        <button> view </button>
                    </div>
                </div>
            </div>



        </div>
    )
}

